# OEIS sequence: A206743

N = 1000
pell = [0,1]
c = 2
while c < N:
    pell.append(c)
    c = pell[-1]*2 + pell[-2]
pell.reverse()
gf = [0]*(N+1)
for p in pell:
    gf = [-x for x in gf]
    gf[0] += 1
    quotient = [0]*(N+1)
    remainder = [0]*(N+1)
    remainder[p] = 1
    for n in range(N+1):
        q = remainder[n]//gf[0]
        for i in range(n,N+1):
            remainder[i] -= q*gf[i-n]
        quotient[n] = q
    gf = quotient
for i in range(N+1):
    print(i,gf[i])
